list* is an alias for `cl-list*' in `cl.el'.<br/><br/>(list* ARG...)<br/><br/>This function has a compiler macro.<br/><br/>Return a new list with specified ARGs as elements, consed to last ARG.<br/>Thus, `(cl-list* A B C D)' is equivalent to `(nconc (list A B C) D)', or to<br/>`(cons A (cons B (cons C D)))'.
